INSERT INTO `servicio` VALUES (32,'Masajista a domicilio','Quiromasajista titulada a domicilio, cuento con todo el material. También soy entrenadora personal, tengo grado superior de Acondicionamiento físico y carrera CAFyD (mayor grado de profesionalidad).   - Realizo masajes: Descontracturantes, relajación, descarga, pre y post competición, de frío y calor, con pistola de masajes y electroeatimulación o compex.   También cuento con bonos de 5 y 10 masajes(descuento por masaje).   Abstenerse de comentarios de índole sexual.   Consulte sin compromiso',30,'data:image/jpeg;base64,',35),(33,'Preparadora física','Técnica superior en Acondicionamiento físico (Tsaf), cursando la carrera (CAFyD) y certificado de entrenadora power explosive.   Realizo entrenamientos tanto presenciales como online, diseño de rutinas y pautas dieteticas. También realizó masajes (quiromasajista)   Si tu objetivo es pérdida de  peso, hipertrofiar, ganar fuerza, salud, bienestar, preparar oposiciones... Puedes contar conmigo.    Tengo bonos conjunto a masajes.   Se preparan bonos y sesiones para regalo.  Más información en mi perfil.   Pregunte sin compromiso.',30,'data:image/jpeg;base64,',35),(34,'Alquiler de caravana','Alquiler de camper desde 95€ (según temporada)   Totalmente eguipadas. ? ¡Descubre la aventura sin límites con nuestras campers! - Portabicis para 2 bicicletas.  - Literas dobles para un descanso placentero. - Menaje completo incluido.  - Ropa de cama y toallas incluidas.  - Ducha interior para refrescarte en cualquier momento del día.  - Nevera y congelador. - Calefacción y agua caliente. ¡Y mucho más para que tu aventura sea inolvidable! ??️  Contrata nuestros servicios',95,'data:image/jpeg;base64,',35),(35,'Clases particulares de inglés','Chica de 20 años, actualmente estudiando la carrera de filología inglés.  Nivel C2 de inglés por Cambridge.   Posibilidad de ir a domicilio y también tengo una sala con todo el material en mi domicilio particular.   15 euros la hora. Descuentos a partir de dos niños.   Joven responsable, profesional y que le apasiona la enseñanza.',15,'data:image/jpeg;base64,',35),(36,'Cerrajero 24 horas','Teléfono: 657899876  Cerrajero jerez disponible las 24 horas, listo para atender cualquier emergencia o situación que requiera asistencia inmediata. Ya sea de día o de noche, estoy comprometido a brindarte un servicio rápido y confiable.  En situaciones de urgencia, como perder las llaves o quedarte fuera de casa, entiendo lo estresante que puede ser. Estoy aquí para resolver esos problemas y proporcionarte acceso rápido y seguro a tu hogar, vehículo o negocio.  Además de servicios de apertura, también ofrezco cambio de cerraduras, reparaciones y asesoramiento en seguridad para garantizar la protección de tus espacios. Utilizo herramientas especializadas y técnicas eficientes para abordar cualquier situación de cerrajería de manera profesional.  La transparencia es fundamental para mí. Antes de comenzar cualquier trabajo, te proporcionaré un presupuesto claro y detallado, para que sepas exactamente qué esperar en términos de costos.  Si te encuentras en una situación de emergencia o necesitas asistencia de cerrajería en cualquier momento, no dudes en contactarme. Estoy aquí para proporcionarte soluciones rápidas y confiables las 24 horas del día. ¡Llámame!',50,'data:image/png;base64,',35),(37,'Fontanero urgente 24 horas','Si te surge cualquier avería puedes llamarme en cualquier momento. Atiendo el teléfono y WhatsApp. Número : 654321123  También atiendo en horario normal, sin carácter urgente. Me desplazo por toda la provincia de Cádiz.  Servicio nocturno tiene un coste mínimo de 60 euros.',50,'data:image/jpeg;base64,',35);
